export enum MyListActionTypes {
  addToMyList = 'addToMyList',
  removeFromMyList = 'removeFromMyList'
}
interface AddToMyList {
  type: MyListActionTypes.addToMyList;
  payload: string;
}

interface RemoveFromMyList {
  type: MyListActionTypes.removeFromMyList;
  payload: string;
}
export function AddToMyList(payload: string) {
  return { type: MyListActionTypes.addToMyList, payload };
}

export function RemoveFromMyList(payload: string) {
  return { type: MyListActionTypes.removeFromMyList, payload };
}

export type myListActions = AddToMyList | RemoveFromMyList;
